import React from 'react'
import Bar from "react-chartjs-2";

function Chart() {
    const shit = {
        x: 125,
        y: 150
    }

    return (
        <div>
            <Bar data={shit}
                 width={150}
                 height={150}
                 options={{ maintainAspectRatio: false }}
            />
        </div>
    )
}

export default Chart
